          <div>
            <h2>Abilities:</h2>
            <ul>
              {pokemonData.moves.map((movesObj, index) => (
                <li key={index}>{movesObj.moves[0].move.name}</li>
              ))}
            </ul>
          </div>
          {/* <pre>{JSON.stringify(pokemonData.moves, null, 2)}</pre> */}
        </div>
      )}
    </div>
  );
};
export default App;
